import React from "react";
import './TrackList.css';

export class TrackList extends React.Component {
    render() {
        return (
          <div className="TrackList">
              <ul>
                  <li>Stone Ocean</li>
                  <li>Golden Wind</li>
                  <li>Diamond is Unbreakable</li>
              </ul>
            {/* <Track /> */}
          </div>
        );
    }
}
